import React from "react";
import Accordion from 'react-bootstrap/Accordion';
const MemberAdvantages = () =>{
    function ContextAwareToggle({ children, eventKey, callback }) {
        const currentEventKey = useContext(AccordionContext);
      
        const decoratedOnClick = useAccordionToggle(
          eventKey,
          () => callback && callback(eventKey),
        );
      
        const isCurrentEventKey = currentEventKey === eventKey;
      
        return (
          <button
            type="button"
            style={{ backgroundColor: isCurrentEventKey ? 'pink' : 'lavender' }}
            onClick={decoratedOnClick}
          >
            {children}
          </button>
        );
      }
      
    return(
       <>
<Accordion defaultActiveKey="0">
      <Card>
        <Card.Header>
          <ContextAwareToggle eventKey="0">Click me!</ContextAwareToggle>
        </Card.Header>
        <Accordion.Collapse eventKey="0">
          <Card.Body>Hello! I'm the body</Card.Body>
        </Accordion.Collapse>
      </Card>
      <Card>
        <Card.Header>
          <ContextAwareToggle eventKey="1">Click me!</ContextAwareToggle>
        </Card.Header>
        <Accordion.Collapse eventKey="1">
          <Card.Body>Hello! I'm another body</Card.Body>
        </Accordion.Collapse>
      </Card>
    </Accordion>



         <div className="home_page">
                  <div className="top_img">

                  </div>
                 <div className="container">
                     <div className="upper_text">
                            <h1>Member advantages</h1>
                            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce venenatis purus odio, vitae sagittis odio accumsan vitae. Maecenas porta luctus tincidunt. Curabitur magna lacus, varius et eleifend vitae, egestas pretium urna. Pellentesque non magna at ante luctus imperdiet. Donec faucibus iaculis facilisis. Vivamus fermentum ligula nec nisi cursus, a fringilla elit gravida. Sed eget suscipit velit. Morbi tincidunt nunc ligula, sit amet sodales nulla faucibus ut. In leo augue, convallis ut nisi quis, mollis tempus orci. Duis vel lectus eu tellus mollis semper. Nullam mollis, leo sit amet rhoncus eleifend, risus ipsum lobortis augue, nec sodales justo purus nec sem. Fusce tristique nisl vel ligula vulputate tincidunt</p>
                     </div>
                </div>
         </div>
       </>
    )
};
export default MemberAdvantages;
